<template>
  <a-card class="atom-list" :bordered="false">
    <!-- 标题 -->
    <template v-if="title" #title>
      <FuncTitle :title="title"></FuncTitle>
    </template>
    <!-- 右侧功能按钮 -->
    <template v-if="funcZone" #extra>
      <FuncZone :funcZone="funcZone"
                :checkedCount="selectedRowKeys.length"
                @func-zone-action="handleFuncAction"
                @func-zone-checkall="handleFuncCheckAll"
                @func-zone-clear-check="handleFuncClearCheck">
      </FuncZone>
    </template>
    <a-checkbox-group v-model:value="selectedRowKeys" @change="handleSelectChange">
      <!-- 列表 -->
      <a-list v-bind="$attrs"
              :dataSource="dataSource"
              :pagination="pagination"
              :loading="loading">
        <!-- 是否有加载更多，pagination优先级更高 -->
        <template v-if="loadMore && !pagination" #loadMore>
          <div class="atom-list-load-more" @click="handleLoadMore">
            {{ loading ? '加载中...' : '加载更多' }}
          </div>
        </template>
        <template #renderItem="{ item, index }">
          <a-list-item>
            <!-- item索引部分 -->
            <a-list-item-meta>
              <!-- 头像  -->
              <template v-if="fieldKeys.avatar || checkable" #avatar>
                <a-checkbox v-if="checkable" :value="item[fieldKeys.key] || index"/>
                <!-- 如果没有avatar时，则将checkbox作为avatar  -->
                <a-avatar v-if="fieldKeys.avatar"
                          :src="item[fieldKeys.avatar]">
                  {{ (item[fieldKeys.title] && item[fieldKeys.title].charAt(0)) || '' }}
                </a-avatar>
              </template>
              <!-- 标题  -->
              <template v-if="fieldKeys.title" #title>
                <span :class="linkable ? 'linkable' : ''" @click="handleTitleLink(item)">
                    <template v-if="itemTitleFormat && itemTitleFormat.type === 'formatBadge'">
                      {{ item[fieldKeys.title] }}
                      <a-badge v-bind="initBadge(item)"></a-badge>
                    </template>
                    <template v-else>
                      {{ item[fieldKeys.title] }}
                    </template>
                  </span>
              </template>
              <!-- 描述  -->
              <template v-if="fieldKeys.description" #description>
                {{ item[fieldKeys.description] }}
              </template>
            </a-list-item-meta>
            <!-- item内容 -->
            <div class="atom-list-item-content">{{ item[fieldKeys.content] }}</div>
            <!-- item extra -->
            <template v-if="fieldKeys.extra" #extra>
              <a-image :width="extraSize"
                       :src="item[fieldKeys.extra]"
                       fallback="data:image/png;base64," />
            </template>
            <!-- 扩展操作 -->
            <template v-if="actions" #actions>
              <span v-for="(action, index) in actions"
                    :key="index"
                    :class="action.name ? 'clickable' : ''"
                    @click="handleRowAction(action, item)">
                <IconFont v-if="action.icon" :type="action.icon"/>
                {{ action.title }}
              </span>
            </template>
          </a-list-item>
        </template>
      </a-list>
    </a-checkbox-group>
  </a-card>
</template>

<script>
/**
 * 格式化列表
 * title: 列表标题
 * dataSource: 数据列表
 * pagination: 分页信息
 * loadMore: 加载更多与pagination互斥，pagination优先级高
 * fieldKeys: 字段key值需要用到哪个展示就填写其字段，没有这个字段不写其key值
 *            extra默认为图片内容
 *            { key: 'id', avatar: 'avatar', title: 'title', description: 'description', content: 'content', extra: 'extra' }
 * actions: 记录上的动作[{ icon, title, name }],如果带action.name，则可点击，否则不可点击
 * funcZone: 顶部右侧功能按钮区，与FormatTable区别不出现字段下拉
 *           可展示新增，选择/取消选择，删除，刷新，下载，以及其他扩展按钮，比如批量删除等
 * linkable: 标题是否可以跳转详情
 * /**
 * itemTitleFormat: 列表中标题字段格式化
 *                  formatBadge { type: 'formatBadge', field: '字段', options: [{ value: '值', color: '颜色' }], option不存在时则不显示badge }
 * extraSize: extra图片的大小
 * loading: 是否加载中
 */
import FuncTitle from '@/components/Common/FuncTitle'
import FuncZone from '@/components/Common/FuncZone'
export default {
  name: 'FormatList',
  components: { FuncTitle, FuncZone },
  props: {
    // 列表标题
    title: {
      type: String,
      required: false
    },
    // 数据列表
    dataSource: {
      type: Array,
      required: false
    },
    // 分页信息
    pagination: {
      type: [Boolean, Object],
      default: false
    },
    // 是否展示加载更多，与pagination互斥，pagination优先级高
    loadMore: {
      type: Boolean,
      default: false
    },
    /**
     * 字段key值，需要用到哪个展示就填写其字段，没有这个字段不写其key值
     * extra默认为图片内容
     * { key: 'id', avatar: 'avatar', title: 'title', description: 'description', content: 'content', extra: 'extra' }
     */
    fieldKeys: {
      type: Object,
      required: true
    },
    /**
     * 操作[{ icon, title, name }],如果带action.name，则可点击，否则不可点击
     */
    actions: {
      type: Array,
      required: false
    },
    // 顶部右侧功能按钮区
    funcZone: {
      type: Object,
      required: false
    },
    // 标题是否可以跳转详情
    linkable: {
      type: Boolean,
      default: false
    },
    /**
     * 列表中标题字段格式化 formatBadge
     * type: 'formatBadge',
     * field: '字段',
     * options: [{ value: '值', color: '颜色' }], option不存在时则不显示badge
     */
    itemTitleFormat: {
      type: Object,
      required:false
    },
    // extra图片的大小
    extraSize: {
      type: [String, Number],
      default: 160
    },
    // 是否加载中
    loading: {
      type: Boolean,
      default: false
    }
  },
  data () {
    return {
      // 是否可选择
      checkable: false,
      // 选中的行keys
      selectedRowKeys: [],
      // 选中的行
      selectedRows: []
    }
  },
  emits: ['list-func-action', 'list-load-more', 'list-title-link', 'list-row-selection', 'list-row-action'],
  methods: {
    // 初始化badge
    initBadge (item) {
      const option = this.itemTitleFormat.options.filter(option => option.value === item[this.itemTitleFormat.field])
      if (this.$utils.isValid(option)) {
        return { dot: true, color: option[0].color || 'red' }
      } else {
        return null
      }
    },
    // 响应标题跳转
    handleTitleLink (item) {
      this.$emit('list-title-link', item)
    },
    /**
     * 响应功能区域操作按钮
     * @param action 响应事件的名称
     * @param extend 是否扩展功能，true | false，true事件直接上抛不做默认处理
     * @param checkable 是否可选择
     */
    handleFuncAction (action, extend, checkable) {
      // 是否开启选择
      this.checkable = checkable
      this.$emit('list-func-action', action, extend)
    },
    // 响应选中的变化
    handleSelectChange () {
      this.selectedRows = this.dataSource.filter((data, index) => this.selectedRowKeys.includes(data[this.fieldKeys.key] || index))
      this.$emit('list-row-selection', this.selectedRowKeys, this.selectedRows)
    },
    // 响应全选与否
    handleFuncCheckAll (checkAll) {
      if (checkAll) {
        this.selectedRowKeys = this.dataSource.map((data, index) => data[this.fieldKeys.key] || index)
        this.selectedRows = this.dataSource
      } else {
        this.selectedRowKeys = []
        this.selectedRows = []
      }
      this.$emit('list-row-selection', this.selectedRowKeys, this.selectedRows)
    },
    // 响应清除选择
    handleFuncClearCheck () {
      this.selectedRowKeys = []
      this.selectedRows = []
      this.$emit('list-row-selection', [], [])
    },
    // 响应扩展操作
    handleRowAction (action, item) {
      if (action.name) {
        this.$emit('list-row-action', action, item)
      }
    },
    // 响应加载更多
    handleLoadMore () {
      this.$emit('list-load-more')
    }
  }
}
</script>

<style lang="less">
@import "FormatList";
</style>
